import React from 'react';
import {useNavigate} from "react-router-dom";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { facartshopping } from '@fortawesome/free-brands-svg-icons'


function Header() {


    const navigate = useNavigate();

    return (
        <div>
            {/* HEADER HEADER HEADER HEADER HEADER */}

            <header>

                {/* function so that clicking logo sends you to homepage */}
                <aside className="logo" onclick={() => {
                    navigate("/");
                }}></aside>

                <nav>

                    <ul className="nav-bar">

                        <li className="nav-item" onClick={() => navigate("/")}>home</li>
                        <li className="nav-item" onClick={() => navigate("/Products")}>products</li>
                        <li className="nav-item" onClick={() => navigate("/Contact")}>contact</li>
                        <li className="nav-item" onClick={() => navigate("/Cart")}><FontAwesomeIcon icon="fa-solid fa-cart-shopping" /></li>


                    </ul>


                </nav>

            </header>



        </div>
    )
}

export default Header
